import Content from "../contents/Content";
import Nav from "../navbar/Nav";
import "./Order.css";
import firebase from "../firebase";
import { Link, useHistory } from "react-router-dom";
import { useAuth } from "../contexts/AuthContext";
function Order() {
  const cu = useAuth();
  const properties = [];
  firebase
    .database()
    .ref("Products")
    .on("value", (snapshot) => {
      const i = snapshot.val();
      for (let id in i) {
        if (i[id].email === cu.currentUser.email) {
          properties.push(i[id]);
        }
      }
    });
  console.log(properties);
  return (
    <>
      <Nav />
      <div className="ordercardmain1">
        <div className="ordercardmain01">
          <p className="ordermore">more</p>
          <div className="ordercardmain2">
            <div className="ordernum">
              <p className="orderheadname2">"dfu"</p>
            </div>

            <div className="ordercardmain3">
              <p className="orderheadname">"dfef"</p>
              <div className="ordersubcard1"></div>
            </div>
          </div>
        </div>
      </div>
      <Content notindex={-1} />
    </>
  );
}
export default Order;
